    true,nt"url": null,nt"notes": "FEMP EISA 432 Compliance Tracking System
    (CTS) enables the public to analyze and generate custom reports of CTS facility
    level data. This data warehouse includes only non-restricted CTS data. The data
    warehouse consists of five data sets (or "data cubes") that may be used to build
    custom reports. There are four detail level data sets used to explore data per module,
    including prior year records: Facility Annual Detail, Comprehensive Evaluation Detail,
    Benchmarked Building Detail, and Project and Follow-up Detail data. The 5th data
    set, Most Recent Facility Overview, allows users to compare the most recent data
    from fields across all of the facility sub-sets.",nt"license_title": "Creative
